import {useState} from "react";
import "./Cards.css"

function Cards() {
    const [produtos, setProdutos] = useState([]);

      async function getApi() { 
      const dados = await fetch("https://634b29e533bb42dca41161ad.mockapi.io/login/v1/users");
      const jDados = await dados.json();
      setProdutos(jDados);

    }
    return (
        <>
        <div className="card">

            <div className="imgBox">
                <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pngegg.com%2Fpt%2Fpng-wxjhz&psig=AOvVaw1utavjkta9WwaTZ72LOcap&ust=1672516832921000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCPjTn_CQovwCFQAAAAAdAAAAABAE" alt="mouse corsair" className="mouse" />
            </div>

            <div className="contentBox">

            <button onclick={getApi}>Produto</button>
            <ul>
            {produtos.map((elemento) => (
              <><li key={elemento.id}>
                </li><p>tituto: {elemento.titulo}
                </p>

                </>
             ))}
            </ul>

            </div>
        </div>  



     </>

    )
}

export default Cards;
